import copy from '../copy.json';

function listItems(data){
  return(data.map((d) => <li>{d}</li>));
}

function Capabilities() {
  return (
    <div>
      <div>
        <h3>Steel</h3>
        <ul>{listItems(copy.Capabilities.Materials.Steel)}</ul>
      </div>
      <div>
        <h3>Aluminum</h3>
        <ul>{listItems(copy.Capabilities.Materials.Aluminum)}</ul>
      </div>
      <div>
        <h3>Brass and Bronze</h3>
        <ul>{listItems(copy.Capabilities.Materials.BrassBronze)}</ul>
      </div>
      <div>
        <h3>Plastics</h3>
        <ul>{listItems(copy.Capabilities.Materials.Plastics)}</ul>
      </div>
    </div>
  );
}

export default Capabilities;
